Esboce seu primeiro documento seguindo os passos: Escolha uma das classes de sua vontade; Crie um arquivo de texto (em branco) chamado main.tex (o nome pode ser qualquer um, na verdade, mas para fins de nos entendermos por aqui, o chamarei de main.tex); Nesse arquivo, escreva \documentclass{<classe>}, trocando <classe> pela classe de documento escolhida. Por exemplo, para a article, seu documento será: \documentclass{article} Escreva alguma frase para o conteúdo do seu documento. O conteúdo do seu documento deve ficar entre uma linha contendo \begin{document} e outra contendo \end{document}. Por exemplo: \begin{document} Texto de exemplo
\end{document} Se você estiver utilizando beamer, cada slide deve estar em um ambiente frame, portanto o código deve ser: \begin{document} \begin{frame} Texto de exemplo. \end{frame}
\end{document} Você pode ainda aproveitar e colocar um título para esse frame, da forma: \begin{document} \begin{frame}{Primeiro Frame} Texto de exemplo. \end{frame}
\end{document} Utilize seu compilador para gerar o PDF a partir do main.tex, por exemplo: $ xelatex main.tex Tendo feito esses 5 passos, você agora terá um arquivo main.pdf. Abaixo seguem tanto o código final de exemplo quanto os PDFs gerados quando utilizando article e beamer.

