Como visto no tópico anterior, o Preâmbulo é o que fica entre a definição da classe e o documento. Nele vão: Os pacotes utilizados (serão vistos mais à frente); (Re)Definição de comandos, ambientes e macros . Macros são nomes que serão substituídos por algum conteúdo quando o seu LaTeX for compilado. Algumas macros são, por exemplo, \title, \author e \date, que representam respectivamente o título, autor e data do documento, e podem ser definidas da seguinte forma: \title{Título de exemplo}
\author{Autor exemplar}
\date{\today} Perceba que em \date foi utilizada uma outra macro como o valor. Essa macro contém o dia em que o documento foi compilado, portanto ela muda toda vez que você compilar em dias diferentes. Caso você queira especificar uma data, basta escrevê-la por extenso: Essas três macros serão úteis, por exemplo, quando você utilizar comandos como o \maketitle, que, dependendo do tipo de documento e das especificações dos pacotes, gera a parte de título do seu documento. No caso de um livro, isso significa a capa. No caso de um artigo, significa a área inicial dele que contém título, autores e etc. No caso de apresentações de slides, significa o slide de abertura/título.

